  state = {
    email: this.props.email,
    prevId: this.props.id,
  };

  componentWillReceiveProps(nextProps) {
    const { prevId } = this.state;
    if (nextProps.id !== prevId) {
      this.setState({
        email: nextProps.email,
        prevId: nextProps.id,
      });
    }
  }
