let stack = [];
for (let i = 0; i < arr.length; i++) {
  while (stack.length && stack[stack.length - 1] > arr[i]) {
    //\u5177\u4F53\u64CD\u4F5C
    stack.pop();
  }
  stack.push(arr[i]);
}
