\u540E\u53F0\u8FDB\u7A0B\u7EC4\uFF1A\u8BE5\u8FDB\u7A0B\u7EC4\u7684\u8FDB\u7A0B\u80FD\u591F\u5BF9\u7EC8\u7AEF\u8BBE\u5907\u8FDB\u884C\u5199\u64CD\u4F5C`,paraId:21,tocIndex:11},{value:"\u5229\u7528 NodeJS \u7684\u4E8B\u4EF6\u673A\u5236\uFF0C\u76D1\u542C exit \u4E8B\u4EF6",paraId:22,tocIndex:14},{value:"\u5728 master.js \u4E2D\u4F7F\u7528 fork \u521B\u5EFA\u5B50\u8FDB\u7A0B",paraId:23,tocIndex:14},{value:"\u76D1\u542C exit \u4E8B\u4EF6\uFF0C1s \u4E4B\u540E\u521B\u5EFA\u4E00\u4E2A\u65B0\u7684\u5B50\u8FDB\u7A0B",paraId:23,tocIndex:14},{value:`// master.js
const { fork } = require('child_process');

const forkChild = () => {
  const child = fork('log.js');
  child.on('exit', () => {
    setTimeout(() => {
      forkChild();
    }, 1000);
  });
};

forkChild();

// log.js
const fs = require('fs');
const path = require('path');

fs.open(path.resolve(__dirname, 'log.txt'), 'w', function (err, fd) {
  setInterval(() => {
    fs.write(fd, process.pid + '\\n', function () {});
  }, 2000);
});
